import s from './filmCatalogPage.module.css';
import FilmElem from './FilmElem/filmElem.jsx';

const FilmCatalogPage = (props) =>{

  let films = props.filmsList.films.map((film)=>{
     return (<FilmElem info={film}/>)
   });


  return (
    <div className={s.filmCatalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.filmList}>
        {films}
      </div>
    </div>
  );
}

export default FilmCatalogPage;

